



const FOLLOW = 'FOLLOW'
const UNFOLLOW = 'UNFOLLOW'
const SET_USERS = 'SET_USERS'

let initialState = {
    users:[
        {id:1 ,photoURL:"data:image/jpeg;base64,", followed:true, name:'Darya' ,  status:'I`m beautiful girl' , location:{contry:'Russia' , city:'Moscow'}},
        {id:2 ,photoURL:"data:image/jpeg;base64,", followed:false, name:'Isrofil' ,  status:'I`m a builder' , location:{contry:'Tadjikistan' , city:'Dushanbe'}},
        {id:3 ,photoURL:"data:image/jpeg;base64,", followed:true, name:'Sasha' ,  status:'Hello every body ' , location:{contry:'Ukrain' , city:'Kiew'}},
        {id:4 ,photoURL:"data:image/jpeg;base64,", followed:false, name:'Petr' ,  status:'Hi i`m Petr' , location:{contry:'Belarus' , city:'Minsk'}}

    ]
};

export const reducerUsers = (state=initialState,action)=>{
        switch (action.type){
            case FOLLOW:
              return {
                ...state,
                users:state.users.map(u=>{
                    if(u.id===action.userid){
                        return {...u,followed:true}
                    }
                    return u;
                })
              }
                
              
            case UNFOLLOW:
                return{
                    ...state,
                users:state.users.map(u=>{
                    if(u.id===action.userid){
                        return {...u,followed:false}
                    }
                    return u;
                })
                  } 
            case SET_USERS:
                return{
                    ...state,users:[...state.users,...action.users]
                } 
                default:
                return state     
        }
}

export const FollowAC = (userid)=>{
    return {
        type: FOLLOW ,userid
    }
}
export const UnFollowAC = (userid)=>{
    return {
        type: UNFOLLOW ,userid
    }
}
export const setUsersAC = (users)=>{
    return {
        type: SET_USERS ,users
    }
}


